import { useEffect, useState } from 'react';
import Button from './Button.js';
import './ListePage.css';

function ListePage(){
    return(
        <div className="main-container border row border p-4">
            <div className="col-md-6 col-12 column border">
                <Button text="Mathématique" className="matière mb-3 col-12"></Button>
                <Button text="Physique Chimie" className="matière mb-3 col-12"></Button>
                <Button text="SVT" className="matière mb-3"></Button>
                <Button text="NSI" className="matière mb-3"></Button>
                <Button text="SI" className="matière mb-3"></Button>
            </div>
            <div className="col-md-6 col-12 d-flex flex-column align-items-center">
                <Button text="Histoire" className="matière mb-3"></Button>
                <Button text="Français" className="matière mb-3"></Button>
                <Button text="Philosophie" className="matière  mb-3"></Button>
                <Button text="HGGSP" className="matière mb-3"></Button>
                <Button text="HLP" className="matière mb-3"></Button>
            </div>
        </div>
    )
}

export default ListePage;
